    [CascadingParameter]
    private Task<AuthenticationState> authenticationStateTask { get; set; }
    System.Security.Claims.ClaimsPrincipal CurrentUser;

    ApplicationUser objUser;
    string strError = "";
    bool ShowPopup = false;

    private List<Positions> positions = new List<Positions>();
    private Positions position = new Positions();


    void AddNewUser()
    {
        position = new Positions();
        position.Id = 0;
        ShowPopup = true;
    }
    async Task SaveUser()
    {
        try
        {
            // Is this an existing user?
            if (position.Id != 0)
            {
                // Get the user
                Positions pos = await db.Positions.FindAsync(position.Id);
                pos.Name = position.Name;
                await db.SaveChangesAsync();
            }
            else
            {
                db.Positions.Add(position);
                await db.SaveChangesAsync();
            }

            // Close the Popup
            ShowPopup = false;
            // Refresh Users
            LoadData();
            position = new Positions();
        }
        catch (Exception ex)
        {
            strError = ex.GetBaseException().Message;
        }
    }
    async Task EditUser(Positions rc)
    {
        position = rc;
        //products = db.Products.Where(x => x.CategoryId == ).ToList();
        ShowPopup = true;
    }
    async Task DeleteUser()
    {
        // Close the Popup
        ShowPopup = false;
        // Get the user
        var rc = await db.Positions.FindAsync(position.Id);
        if (rc != null)
        {
            db.Positions.Remove(rc);
            await db.SaveChangesAsync();
        }
        LoadData();
    }
    void ClosePopup()
    {
        // Close the Popup
        ShowPopup = false;
    }
 

    protected override async Task OnInitializedAsync()
    { 
        LoadData();
    }

    public void LoadData()
    {
        positions = db.Positions.ToList();        
    }

